        public static async Task EnsureSeedData(WebApplication app)
        {
            var services = app.Services.CreateScope().ServiceProvider;
            await EnsureSeedData(services);
        }

        public static async Task EnsureSeedData(IServiceProvider serviceProvider)
        {
            using (var scope = serviceProvider.GetRequiredService<IServiceScopeFactory>().CreateScope())
            {
                var env = scope.ServiceProvider.GetRequiredService<IWebHostEnvironment>();

                var contextBusiness = scope.ServiceProvider.GetRequiredService<AcmeDbContext>();
                var contextIdentity = scope.ServiceProvider.GetRequiredService<AcmeIdentityDbContext>();
                var userManager = scope.ServiceProvider.GetRequiredService<UserManager<IdentityUser>>();
                var roleManager = scope.ServiceProvider.GetRequiredService<RoleManager<IdentityRole>>();
                var vendedorService = scope.ServiceProvider.GetRequiredService<IVendedorService>();

                if (env.IsDevelopment() || env.IsEnvironment("Docker") || env.IsStaging())
                {
                    await contextBusiness.Database.MigrateAsync();
                    await contextIdentity.Database.MigrateAsync();

                    await CriarRoles(roleManager);
                    await CriarUsuario(userManager, "admin@acme.com", "Admin!138", Roles.Admin);
                    await EnsureSeedProducts(contextBusiness, userManager, vendedorService);
                }
            }
        }

