        private static async Task<IdentityUser> CriarUsuario(UserManager<IdentityUser> userManager, string email, string senha, string roleName)
        {
            var user = await userManager.FindByEmailAsync(email);

            if (user == null)
            {
                user = new IdentityUser
                {
                    UserName = email,
                    Email = email,
                    EmailConfirmed = true
                };

                var result = await userManager.CreateAsync(user, senha);
                if (result.Succeeded)
                {
                    await userManager.AddToRoleAsync(user, roleName);
                    return user;
                }

            }
            return null;
        }

        private static async Task CriarRoles(RoleManager<IdentityRole> roleManager)
        {
            if (! await roleManager.RoleExistsAsync(Roles.Admin))
            {
                await roleManager.CreateAsync(new IdentityRole(Roles.Admin));
            }

            if (! await roleManager.RoleExistsAsync(Roles.Vendedor))
            {
                await roleManager.CreateAsync(new IdentityRole(Roles.Vendedor));
            }
        }


